export function hintPlace(place) {
    if (place === 1) {
        return 'Парк'
    } else if (place === 2) {
        return 'Достопримечательность'
    } else if (place === 3) {
        return 'Кафе'
    } else if (place === 4) {
        return 'Ресторан'
    } else if (place === 5) {
        return 'Музей'
    } else if (place === 6) {
        return 'Театр'
    } else if (place === 7) {
        return 'Кинотеатр'
    } else if (place === 8) {
        return 'Другое'
    }
}
